import {Component} from "react";

export default class List extends Component {

    state = {
        movies: [
            {
                id: 1,
                name: "It",
                director: "Andy Muschietti",
            },
            {
                id: 2,
                name: "X-Men",
                director: "Bryan Singer",
            },
            {
                id: 3,
                name: "Green Mile",
                director: "Frank Darabont",
            },
        ]
    };

    render() {
      return (
        <div>
            <ul>
                {
                    this.state.movies.map(mov => <li>{mov.name}</li>)
                }
            </ul>
        </div>
      );
    }
  }
